import ImageGalleryItem from './ImageGalleryItem'

export default function ImageGallery({ images }) {
    return <ul className="ImageGallery">
        {images.map(({ id, pageURL, tags }) => {
            return <ImageGalleryItem src={pageURL} alt={tags} id={id} />
        })}
    </ul>
}
